INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3245390502810', 'Pommes Rissolees', 'Nos pommes de terre sont issues des meilleures variétés, notamment la Bintje. Elles sont soigneusement sélectionnées pour la fabrication de nos pommes rissolées. Nos pommes de terre sont épluchées à la vapeur, coupées et préfrites dans l\'huile de tournesol. Pour des pommes rissolées croustillantes et généreuses. POMMES DE TERRE RISSOLÉES PRÉFRITES - SURGELÉ. Ingrédients Pomme de terre 97%, huile de tournesol 3%, dextrose. Préparation À la friteuse : Plongez les pommes rissolées encore surgelées par petites quantités dans de l\'huile chauffée à 1750C et laissez dorer pendant 4 à 6 minutes. Pour limiter le surplus de matière grasse, laissez reposer les pommes rissolées sur du papier absorbant. Pensez à renouveler le bain d\'huile après 10 à12 fritures. A la poêle : Préchauffez de l\'huile dans une poêle. Déposez une couche de pommes rissolées et faites frire pendant 10 à 15 minutes jusqu\'à ce qu\'elles soient croustillantes. Remuez de temps en temps pendant la cuisson. Au four : Préchauffez le four à 2200C. Étalez les pommes rissolées sur une seule couche. Faites cuire pendant 15 à 20 minutes. Retournez-les une fois en cours de cuisson. Conservation', 'https://static.openfoodfacts.org/images/products/324/539/050/2810/front_fr.12.400.jpg', '3.3', '0.4', '19', '0.7', '2.4', '2.2', '0.13', '0.0511811023622047', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
