VALUES ('3245411439897', 'Bûche glacée Exotique Vanille, Mangue & passion', 'Sorbet au fruit de la passion et à la mangue 38,4% : Eau, jus de fruit de la passion à base de concentré 8,2%, purée de mangue 8%, sirop de glucose-fructose, sucre, arôme naturel de mangue, arôme naturel de fruit de la passion, gélifiants : pectines - gomme Tara - gomme xanthane, colorants : caroténoïdes et rocou, protéines de pois hydrolysées. Glace à la vanille 29,7% : Lait écrémé reconstitué, eau, sirop de glucose-fructose, sucre, graisse végétale de coprah, lactose et protéines de lait, sirop de glucose, arôme naturel de vanille, émulsifiant: mono - et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar. Sorbet au fruit de la passion 23,8% : Eau, jus de fruit de la passion à base de concentré 4,9%, sucre, sirop de glucose-fructose, arôme naturel de fruit de la passion, gélifiants : pectines - gomme Tara - gomme xanthane, acidifiant : acide citrique, protéines de pois hydrolysées, colorants: rocou et curcumine. Sauce au fruit de la passion 7,2% : Sirop de glucose, sucre, jus de fruits de la passion à base de concentré 1,3%, purée de fruit de la passion 1,1%, gélifiant : pectines, eau, jus concentré de citron. _Décors :_ Morceaux de meringue 0,5% : Meringue 0,4% (sucre, blanc d\'oeuf, amidon de blé), beurre de cacao, sucre. Plaquette en chocolat blanc 0,4% : Sucre, beurre de cacao, lait entier en poudre, lait écrémé en poudre, matière grasse laitière anhydre, cacao maigre en poudre, émulsifiants : lécithines de soja et polyricinoléate de polyglycérol, arôme naturel de vanille. Les pourcentages sont exprimés sur l\'ensemble du produit. Peut contenir des traces d\'arachides et de fruits à coque. Visuel non contractuel.', 'https://static.openfoodfacts.org/images/products/324/541/143/9897/front_fr.14.400.jpg', '2.8', '2.4', '31', '27', '0.6', '0.9', '0.09', '0.0354330708661417', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
