VALUES ('3245412969683', '20 Canapés traiteur', '5 Canapés tomate marinée, fromage frais et basilic sur pain de mie à la tomate (28,9%) : Pain de mie à la tomate 8,2% (farine de blé [farine de blé, gluten de blé, farine de blé malté], eau, concentré de tomate 0,8%, huile de tournesol, levure, sucre, lait écrémé en poudre, sel, farine de fève, gluten de blé, origan, émulsifiants : mono - et diglycérides d\'acide gras et stéaroyl-2-lactylate de sodium, basilic, antioxydant : acide ascorbique), fromage blanc, tomate semi-déshydratée marinée 7,3% (tomate 6,9%, huile de colza, origan, sel, ail), fromage frais foisonné 4,8% (fromage [babeurre, lait écrémé, crème, protéines de lait, babeurre déshydraté, ferments lactiques], sel), basilic 0,5%, amidon modifié de tapioca, épaississants : farine de graines de caroube et gomme xanthane, protéines de lait. 5 Mini clubs sandwichs jambon Serrano, beurre et figue sur pain de mie cacao et pain brioché (26,1%) : Jambon Serrano 6,1% (jambon de porc, sel, conservateurs : nitrate de potassium et nitrite de sodium, antioxydant : ascorbate de sodium), pain de mie cacao 5,8% (farine de blé [farine de blé, gluten de blé, farine de blé malté], eau, huile de tournesol, remoulage de blé, poudre de cacao maigre 0,1%, sucre, farine de fève, gluten de blé, sel, levure, malt d\'orge torréfié, émulsifiants : mono - et diglycérides d\'acide gras et stéaroyl-2-lactylate de sodium, antioxydant : acide ascorbique), pain brioché 5,8% (farine de blé [farine de blé, gluten de blé, farine de blé malté], eau, beurre 0,5%, sucre, levure, œuf en poudre 0,15%, sel, lait écrémé en poudre, farine de fève, gluten de blé, émulsifiants : mono - et diglycérides d\'acide gras et stéaroyl-2-lactylate de sodium, antioxydant : acide ascorbique), eau, beurre 2,3%, figue 1,3% (figue, farine de riz), préparation pour sauce béchamel en poudre (lactosérum, amidon modifié de pomme de terre, matière grasse de colza, lait écrémé en poudre, sel, farine de blé, protéines de lait, sirop de glucose, arômes naturels). 5 Canapés préparation à base de crème et jus de citron, chiffonnade de saumon fumé, décor sésame, poivron rouge et aneth, sur pain polaire (25,3%) :Crème fraîche 7,4%, saumon fumé 7,3% (saumon Atlantique (Salmo salar), sel), pain polaire 6,9% (farine de blé, eau, farine de seigle, sirop de sucre, sucre, gluten de blé, huile de colza, farine de froment fermentée, sel, fibres d\'avoine, levure, émulsifiants : mono - et diglycérides d\'acide gras et esters monoacétyltartriques et diacéthyltartriques des  mono - et diglycérides d\'acide gras, poudre à lever : carbonate acide d\'ammonium, farine de malt d\'orge, agent de traitement de la farine : acide ascorbique), fromage blanc, graines de sésame décortiquées 0,2%, graines de sésame noir 0,2%, poivron rouge en poudre 0,1%, amidon modifié de tapioca, épaississants : farine de graines de caroube et gomme xanthane, protéines de lait, jus de citron concentré 0,05%, jus de citron vert 0,05%, aneth 0,04%, sel, poivre. 5 Canapés fromage de chèvre, cranberries et pavot sur pain de mie cacao (19,7%) : Fromage de chèvre au lait pasteurisé 10,4%, pain de mie cacao 8,6% (farine de blé [farine de blé, gluten de blé, farine de blé malté], eau, huile de tournesol, remoulage de blé, poudre de cacao maigre 0,1%, sucre, farine de fève, gluten de blé, sel, levure, malt d\'orge torréfié, émulsifiants : mono - et diglycérides d\'acide gras et stéaroyl-2-lactylate de sodium, antioxydant : acide ascorbique), cranberries en poudre 0,3% (cranberries, sucre, huile de tournesol, farine de riz), miel, pavot 0,1%, amidon modifié de tapioca, épaississants : farine de graines de caroube et gomme xanthane, protéines de lait , antioxydants : acide ascorbique et alphatocophérol. Peut contenir des traces de : soja, fruits à coque, crustacés, céleri, moutarde. Les pourcentages sont exprimés sur l\'assortiment de 20 canapés.', 'https://static.openfoodfacts.org/images/products/324/541/296/9683/front_fr.26.400.jpg', '11', '5.4', '23', '6.7', '2', '8.7', '1.3', '0.511811023622047', '', '0');

