et 4,5%, tomate semi-déshydratée, chapelure (farine de blé, sel, levure, calcium, fer, niacine, thiamine), fibre de blé, protéine de blé, romarin, sel, sucre, épaississants : gomme xanthane et gomme guar, poivre blanc, dextrose, blanc d\'œuf en poudre, huile de tournesol, œuf entier en poudre, farine de fèves, gluten de blé, farine de blé malté, levure désactivée.  Pourcentages exprimés sur chaque bouchée. Ce produit contient de la viande de poulet d\'origine Union Européenne. Peut contenir des traces de poissons, soja, fruits à coque, mollusques,crustacés, graines de sésame.', 'https://static.openfoodfacts.org/images/products/324/541/347/6296/front_fr.25.400.jpg', '22', '5.6', '15', '3.2', '3.7', '9.3', '1.3', '0.511811023622047', '', '0');

